patch:
diff --git a/src/xxd/xxd.c b/src/xxd/xxd.c
index cf8b4ea6a..9922a1de6 100644
--- a/src/xxd/xxd.c
+++ b/src/xxd/xxd.c
@@ -1098,25 +1098,30 @@ main(int argc, char *argv[])
           if (hextype == HEX_LITTLEENDIAN)
             c += 1;

-          COLOR_PROLOGUE
-          begin_coloring_char(l,&c,e,ebcdic);
+          /* Check for buffer overflow before writing color prologue (5 bytes) */
+          if (c + 5 < (int)sizeof(l)) {
+            COLOR_PROLOGUE
+            begin_coloring_char(l,&c,e,ebcdic);
 #if defined(__MVS__) && __CHARSET_LIB == 0
-          if (e >= 64)
-            l[c++] = e;
-          else
-            l[c++] = '.';
+            if (c + 1 < (int)sizeof(l))
+              l[c++] = (e >= 64) ? e : '.';
 #else
-          if (ebcdic)
-            e = (e < 64) ? '.' : etoa64[e-64];
-          l[c++] = (e > 31 && e < 127) ? e : '.';
+            if (ebcdic)
+              e = (e < 64) ? '.' : etoa64[e-64];
+            if (c + 1 < (int)sizeof(l))
+              l[c++] = (e > 31 && e < 127) ? e : '.';
 #endif
-          COLOR_EPILOGUE
+            if (c + 4 < (int)sizeof(l))
+              COLOR_EPILOGUE
+          }
           n++;
           if (++p == cols)
             {
-              l[c++] = '\n';
-              l[c++] = '\0';
-              xxdline(fpo, l, autoskip ? nonzero : 1);
+              if (c + 2 < (int)sizeof(l)) {
+                l[c++] = '\n';
+                l[c++] = '\0';
+                xxdline(fpo, l, autoskip ? nonzero : 1);
+              }
               nonzero = 0;
               p = 0;
             }
